   If you've tried other music production software on the market today and 
   found it cumbersome, limited or just plain un-inspiring, you've come to 
   the  right  place.  Tracktion  is  a  revolutionary,  easy-to-use music 
   production application that contains  everything most people will  ever 
   need to professionally record  and mix music on  a Windows PC - without 
   all the hassles  and limitations of  other audio software.  Tracktion's 
   hallmark is a clean, single-screen interface and streamlined operation, 
   whether  you're  recording  tracks, MIDI  programming,  or  mixing down 
   songs. It offers rock-solid operation, VST and ReWire support, and very 
   low CPU usage  with operating systems  ranging from Windows 2000 or  XP 
   And it contains a whole host of professional features that you can 
   actually use from day one. 


   Features: 


   ?  Clean,  single-screen  interface  for  easy  recording,  mixing and 
      mastering   

   ?  Unlimited track count (Depending on your computer's CPU)   

   ?  Support for sample rates up to 192kHz   

   ?  Importing and exporting of all major file types   

   ?  Simple drag-and-drop audio editing   

   ?  Track freezing for conserving CPU power   

   ?  VST instrument and plug-in support   

   ?  ReWire? support for use with Reason? software   

   ?  Powerful MIDI programming and editing with step recording   

   ?  Built-in Quicktime? support   

   ?  64-bit mix engine for superb sound quality   

   ?  Built-in sampler   

   ?  MIDI mapping for external controllers   

   ?  MTC input/output, MIDI Clock output, and MMC send/receive   

   ?  Powerful project management features   


